import React from 'react';
import Detail from './component/DetailPokemon/DetailPokemon';
import './app.css'
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'
import Login from './component/Login/Login';
import ShowPokemon from './component/ShowPokemon/ShowPokemon';
import Header from './page/Header/Header';
import Home from './component/Layouts/HomeLayout';
import Ability from './component/Layouts/AbilityLayout';
function App() {
  return (
    <Router>
    <Header/>
    <Switch>
        <Route path='/' exact >
          <Home />
        </Route>
        <Route path='/login' exact>
          <Login/>
        </Route>
        <Route
            path='/pokemon/:id'
            exact
            render={props => 
              <Detail {...props}/>
            }
          />
        <Route
            path='/ability/:id'
            exact
            render={props => 
              <ShowPokemon {...props} type='ability'/>
            }
          />
        <Route
          path='/ability/:id'
          exact
          render={props => 
            <ShowPokemon {...props} type='ability'/>
          }
        />
      </Switch>
    </Router>
  )
}

export default App;
